import React from 'react';
import { useNavigate } from 'react-router-dom';
import './FeedbackForm.css';

const ServiceSelection = ({ setServiceType }) => {
  const navigate = useNavigate();

  const handleServiceClick = (service) => {
    setServiceType(service); // Set the service type
    navigate('/emoji-selection'); // Navigate to emoji selection page
  };

  return (
    <div className="service-selection-container">
      <h1>Select a Service</h1>
      <div className="service-icons">
        <div className="icon" onClick={() => handleServiceClick('service1')}>
          <img src="/path/to/icon1.png" alt="Service 1" />
          <span>Service 1</span>
        </div>
        <div className="icon" onClick={() => handleServiceClick('service2')}>
          <img src="/path/to/icon2.png" alt="Service 2" />
          <span>Service 2</span>
        </div>
        <div className="icon" onClick={() => handleServiceClick('service3')}>
          <img src="/path/to/icon3.png" alt="Service 3" />
          <span>Service 3</span>
        </div>
      </div>
    </div>
  );
};

export default ServiceSelection;
